import React from 'react';

function About() {
  return (
    <section id="about" className="about">
      <h2>About Me</h2>
      <p>
      I am a dedicated software developer currently pursuing a Master's degree in Applied Computer Science. With a strong foundation in mobile and web application development, I thrive in creating intuitive and impactful digital experiences. My technical expertise encompasses an array of technologies, including React.js, Node.js, MongoDB, PHP, MySQL, Ruby, Python Flask, React Native, Flutter, and Swift iOS. From building dynamic front-end interfaces with React.js to optimizing back-end processes with Node.js, I bring a comprehensive skill set to the table. My proficiency extends to crafting engaging mobile apps using React Native and Flutter, as well as developing seamless iOS applications with Swift.

As a Graduate Research Assistant at GVSU, I worked on the AskLily chat feature for the GVSU Laker iOS app, leveraging Conversational AI and Swift Web Views for seamless interactions. Proven track record in testing, deployment, and ongoing maintenance to ensure optimal performance. Research enthusiast in Hugging Face LLMs, Langchain, and Neo4j for specialized AI chat solutions.
      </p>
      {/* Include your work description here */}
    </section>
  );
}

export default About;
